  \"2014-11-13T17:06:21.489402\",\n\t\"name\": \"snap-retail-locator\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Supplemental Nutrition Assistance Program
  (SNAP) Retailer Locator is designed to help recipients find SNAP local stores that
  welcome SNAP benefits.   The tool is intended to offer assistance to program recipients,
  State eligibility workers, community organizations - such as food banks - and others
  providing assistance to those in need.  SNAP Retail Locator tool will make it easier
  for SNAP participants, especially those who may be new and unfamiliar with the program,
  to gain access to food. The locator is available at http://www.fns.usda.gov/snap/retailerlocator.htm\",\n\t\"license_title\":
